const Card = ({ monster, name }) => {
  return (
    <div className="_cardContainer" style={{ backgroundColor: monster.color }}>
      <img
        src={monster.img.name}
        className="_card_image"
        alt="{monster.name} "
      />
    </div>
  );
};

export default Card;
